css:
.build-settings {
  cursor: default;
  -webkit-user-select: none;
  height: 100%;
  display: flex;
  flex-direction: column;
}
.build-settings #config {
  overflow-y: auto;
}
.build-settings .top {
  display: flex;
  flex-flow: row wrap;
  justify-content: space-between;
}
.build-settings .top .align {
  display: flex;
  padding: 0 0 0 5px;
}
.build-settings .panel-heading .panel-text {
  font-size: 1.25em;
  font-weight: bold;
}
.build-settings .panel-heading .btn {
  top: 0px;
}
.build-settings input[type="checkbox"] {
  flex: none;
  -webkit-appearance: none;
  display: inline-block;
  position: relative;
  font-size: inherit;
  margin: 0 .75em 0 0;
  vertical-align: top;
  width: 1.5em;
  height: 1.5em;
  cursor: pointer;
  outline: 0;
  border-radius: 2px;
  background-color: #777777;
  transition: background-color 0.16s cubic-bezier(0.5, 0.15, 0.2, 1);
}
.build-settings input[type="checkbox"]:focus {
  box-shadow: 0 0 0 1px #eeeeee;
}
.build-settings input[type="checkbox"]:active {
  background-color: #17ca65;
}
.build-settings input[type="checkbox"]:before,
.build-settings input[type="checkbox"]:after {
  content: "";
  position: absolute;
  top: 1.1em;
  left: .6em;
  height: .16em;
  min-height: 2px;
  border-radius: 1px;
  background-color: #ffffff;
  transform-origin: 0% 0%;
  opacity: 0;
  transition: transform 0.1s cubic-bezier(0.5, 0.15, 0.2, 1), opacity 0.1s cubic-bezier(0.5, 0.15, 0.2, 1);
}
.build-settings input[type="checkbox"]:before {
  width: .45em;
  transform: rotate(225deg) scale(0);
}
.build-settings input[type="checkbox"]:after {
  width: .9em;
  margin: -1px;
  transform: rotate(-45deg) scale(0);
  transition-delay: .05s;
}
.build-settings input[type="checkbox"]:checked {
  background-color: #17ca65;
}
.build-settings input[type="checkbox"]:checked:active {
  background-color: #777777;
}
.build-settings input[type="checkbox"]:checked:before,
.build-settings input[type="checkbox"]:checked:after {
  opacity: 1;
}
.build-settings input[type="checkbox"]:checked:before {
  transform: rotate(225deg) scale(1);
  transition-delay: .05s;
}
.build-settings input[type="checkbox"]:checked:after {
  transform: rotate(-45deg) scale(1);
  transition-delay: 0;
}
